if (response_iserror) { 
 done({ 
 "response_headers": response_headers, 
 "response_status_code": response_status_code, 
 "response_body":{"error":"Invalid Credentials "}, 
 "continue": false 
 }); 
} 
else{ 
 done({ 
 "continue":true 
 }) 
}

if(configuration['authentication.type'] === 'oauth2'){
  done({ 
  "continue": false
})
}
else if ((configuration['pipedrive.email'] === null || configuration['pipedrive.email'] === "" || configuration['pipedrive.password'] === null || configuration['pipedrive.password'] == "") && configuration['authentication.type'] === 'emailPassword') { 
 done({ 
 "response_body": { 
 "error": "Could not Create instance.Please enter email id and password" 
 }, 
 "response_status_code": 400, 
 "continue": false 
 }) 
} else if (configuration['authentication.type'] === 'accessToken') { 
 const http = require('https'); 
 let config = configuration; 
 let path = `/v1/organizations?api_token=${config['pipedrive.api.token']}&limit=1`; 
 let options = { 
 hostname: 'api.pipedrive.com', 
 path: path, 
 headers: { 
 'Accept': 'application/json' 
 } 
 }; 

 const apiCall = http.request(options); 
 apiCall.on('response', res => { 
 let rawData = ''; 
 res.on('data', (chunk) => rawData += chunk); 
 res.on('end', () => { 
 try { 
 let parsedData = JSON.parse(rawData); 

 if (res.statusCode == 200) { 
 done({ 
 "response_body": parsedData, 
 "continue": false 
 }); 
 } else { 
 done({ 
 "response_body": { 
 "error": "Invalid Credentials" 
 }, 
 "continue": true 
 }); 

 } 
 } catch (e) { 
 done({ 
 "response_body": { 
 "error": "Invalid Credentials" 
 }, 
 "response_error": "Invalid Credentials", 
 "continue": true 
 }); 
 } 
 }); 
 }); 

 apiCall.on('error', err => { 
 done({ 
 "response_body": { 
 "error": "Invalid Credentials" 
 }, 
 "response_error": "Invalid Credentials", 
 "continue": true 
 }); 
 }); 

 apiCall.end(); 

} else { 
 done(); 
}

if (response_iserror) { 
 done({ 
 "response_body": {"error":"Entered wrong credentials"}, 
 "response_headers": response_headers, 
 "response_status_code": response_status_code, 
 "continue": false 
 }); 
} 
else{ 
 done({ 
 "continue":true 
 }) 

}

var vendorObjectMappings = {
	"notes": "note",
	"contacts": "person",
	"accounts": "organization",
	"opportunities": "deal",
	"activities": "activity",
	"users": "user"
}
var vendorObjectName;
var objectName = request_vendor_path.substring(1).toLowerCase();

for (var key in vendorObjectMappings) {
	if (objectName.endsWith(key)) {
		vendorObjectName = vendorObjectMappings[key] + "Fields";
	}
}
if (vendorObjectName === undefined) {
	return;
}
return {
	request_vendor_path: '/' + vendorObjectName
}

var requestPath = request_path.substring(18);
var objectName = requestPath.substring(0, requestPath.length - 9);
objectName = objectName.toLowerCase();
if (objectName.endsWith("notes")) {
	objectName = "notes";
}
if (objectName.endsWith("activities")) {
	objectName = "activities";
}

if(['notes', 'contacts', 'accounts', 'opportunities', 'activities', 'users'].indexOf(objectName) < 0){
  return {
		response_body: meta_data
	};
}
var skipKeys = [];
if (response_body.success === false) {
	return {
		response_iserror: true,
		response_error: response_body.error
	};
}
if (response_body.data === null) {
	return {
		response_body: meta_data
	};
}
var metadata = meta_data;
var fields = Java.from(metadata.fields);
var vendorData = Java.from(response_body.data);
var vendorMetadata = new java.util.ArrayList();
subsidizeMetadata(objectName, vendorMetadata);
vendorData.forEach(function(vendorEntry) {
	var metadataEntry = {};
	metadataEntry.vendorPath = vendorEntry.key;
	if (skipKeys.indexOf(metadataEntry.vendorPath) !== -1) {
		return;
	}
	metadataEntry.vendorNativeType = vendorEntry.field_type;
	metadataEntry.vendorDisplayName = vendorEntry.name;

  if(typeof mandatory_flag === 'boolean'){
    	metadataEntry.vendorRequired = vendorEntry.mandatory_flag;
  }else{
  	metadataEntry.vendorRequired = false;
  }
	metadataEntry.type = vendorEntry.field_type;
	if (metadataEntry.vendorPath.endsWith("id")
		&& skipKeys.indexOf(metadataEntry.vendorPath) === -1) {
		metadataEntry.type = 'number';
	}
	if (metadataEntry.vendorPath === 'done') {
		metadataEntry.type = 'boolean';
	}
	metadataEntry.type = getType(metadataEntry.type);
	if (metadataEntry.type === 'date') {
		metadataEntry.mask = 'yyyy-MM-dd HH:mm:ss';
	}
	if (vendorEntry.options) {
		metadataEntry.choices = vendorEntry.options;
	}
	vendorMetadata.add(metadataEntry);
});

vendorMetadata = addMissingMetadata(fields, vendorMetadata);

return {
	response_body: {fields:vendorMetadata}
};

function addMissingMetadata(fields, vendorMetadata) {
	fields.forEach(function(fieldEntry) {
		var match = findMatch(vendorMetadata, fieldEntry);
		if (match === false) {
			vendorMetadata.add(fieldEntry);
		}
	});
	return vendorMetadata;
}

function findMatch(vendorMetadata, fieldEntry) {
	var exists = false;
	for (var i = 0; i < vendorMetadata.length; i++) {
		var vendorMetaEntry = vendorMetadata[i];
		if (vendorMetaEntry.vendorPath === fieldEntry.vendorPath) {
			exists = true;
			break;
		}
	}
	return exists;
}

function subsidizeMetadata(objectName, vendorMetadata) {
	switch (objectName) {
		case "accounts":
			addIDMetadata(vendorMetadata, "owner_id");
			return;
		case "contacts":
			addIDMetadata(vendorMetadata, "owner_id");
			addPhoneMetadata(vendorMetadata);
			addEmailMetadata(vendorMetadata);
			addOrgIDMetadata(vendorMetadata);
			return;
		case "notes":
			addOrganizationMetadata(vendorMetadata);
			addUserMetadata(vendorMetadata);
			return;
		case "opportunities":
			addIDMetadata(vendorMetadata, "user_id");
			addIDMetadata(vendorMetadata, "creator_user_id");
			return;
	}
}

function getType(pipedriveType) {
	switch (pipedriveType) {
		case 'varchar':
		case 'enum':
		case 'text':
		case 'monetary':
		case 'status':
		case 'varchar_options':
		case 'visible_to':
		case 'varchar_auto':
		case 'address':
			return 'string';
		case 'int':
		case 'double':
			return 'number';
		case 'date':
		case 'time':
			return 'date';
		default:
			return pipedriveType;
	}
}

function addIDMetadata(vendorMetadataCollection, prefix) {
	vendorMetadataCollection.add(getMetadataObject("string", "name", prefix));
	vendorMetadataCollection.add(getMetadataObject("boolean", "has_pic", prefix));
	vendorMetadataCollection.add(getMetadataObject("boolean", "active_flag", prefix));
	vendorMetadataCollection.add(getMetadataObject("number", "id", prefix));
	vendorMetadataCollection.add(getMetadataObject("number", "value", prefix));
	vendorMetadataCollection.add(getMetadataObject("string", "email", prefix));
	skipKeys.push(prefix);
}

function addOrganizationMetadata(vendorMetadataCollection) {
	vendorMetadataCollection.add(getMetadataObject("string", "name", "organization"));
	skipKeys.push("organization");
}

function addUserMetadata(vendorMetadataCollection) {
	vendorMetadataCollection.add(getMetadataObject("string", "name", "user"));
	vendorMetadataCollection.add(getMetadataObject("string", "email", "user"));
	vendorMetadataCollection.add(getMetadataObject("boolean", "is_you", "user"));
	skipKeys.push("user_id");
}

function addOrgIDMetadata(vendorMetadataCollection) {
	vendorMetadataCollection.add(getMetadataObject("number", "owner_id", "org_id"));
	vendorMetadataCollection.add(getMetadataObject("string", "cc_email", "org_id"));
	vendorMetadataCollection.add(getMetadataObject("string", "name", "org_id"));
	vendorMetadataCollection.add(getMetadataObject("number", "people_count", "org_id"));
	vendorMetadataCollection.add(getMetadataObject("number", "value", "org_id"));
	skipKeys.push("org_id");
}

function addPhoneMetadata(vendorMetadataCollection) {
	["phone1", "phone2", "phone3"].forEach(function(phoneKey) {
		vendorMetadataCollection.add(getMetadataObject("string", "label", phoneKey));
		vendorMetadataCollection.add(getMetadataObject("string", "value", phoneKey));
		vendorMetadataCollection.add(getMetadataObject("boolean", "primary", phoneKey));
	})
	skipKeys.push("phone1", "phone2", "phone3");
}

function addEmailMetadata(vendorMetadataCollection) {
	["email1", "email2", "email3"].forEach(function(emailKey) {
		vendorMetadataCollection.add(getMetadataObject("string", "label", emailKey));
		vendorMetadataCollection.add(getMetadataObject("string", "value", emailKey));
		vendorMetadataCollection.add(getMetadataObject("boolean", "primary", emailKey));
	})
	skipKeys.push("email1", "email2", "email3");
}

function getMetadataObject(type, key, prefix) {
	return {
		type: type,
		vendorPath: prefix + "." + key
	}
}

var isPolling = false;
if (events.eventId && events.objectType) {
	var isPolling = true;
}

if (isPolling) {
	var providerEvents = [];
	var objectType = events.objectType;
	var objects = Java.from(events[objectType]);
	objects.forEach(function(object) {
		var providerEvent = {};
		var addTime = new Date(object.add_time);
		var updateTime = new Date(object.update_time);
		providerEvent.event_object_type = objectType;
		providerEvent.event_date = updateTime.toISOString();
		providerEvent.event_object_id = object.id;
		providerEvent.event_type = addTime - updateTime < 0 ? 'UPDATED' : 'CREATED';
		providerEvents.push(providerEvent);
	});
	return {
		"events": providerEvents
	};
}

var action = events.meta.action;
var objectType = events.meta.object;
var objectId = events.meta.id;
var date = new Date(parseInt(events.meta.timestamp) * 1000).toISOString();

function determineEventType(action) {
	switch(action) {
		case 'updated':
		case 'merged':
			return 'UPDATED';
		case 'added':
			return 'CREATED';
		case 'deleted':
			return 'DELETED';
	}
}

var providerEvent = {
	"event_date": date,
	"event_type": determineEventType(action),
	"event_object_id": objectId,
	"event_object_type": objectType
};

return {
	"events": [providerEvent]
};
